//Count how many lines have been passed to the decrypt function
static uint32_t line_counter = 0;
//Count how many lines have been printed
static uint32_t print_counter = 0;

// Thankfully, our hacker left the key on a sticky note.
char key[] = "youvebeengheithed";
char alphabet[] = "abcdefghijklmnopqrstuvwxyz*@&X;:,. ";



uint32_t get_index(char* string, char c) {
    uint32_t index = 0;
    while (string[index] != c) {
        if (string[index] == '\0') {
            return (uint32_t)-1;
        }
        index++;
    }
    return index;
}

void defuse_bomb() {
    // Defusing bombs is hard work
    for (uint32_t i = 0; i < 10000; i++) {
        asm volatile("nop");
    }
    return;
}


char* decrypt(uint32_t start, uint32_t end, char* key) {
    char* string = new char[end - start + 1];
    for (uint32_t i = start; i < end; i++) {
        char c = encrypted[i];
        uint32_t charIndex = get_index(alphabet, c);
        for (uint32_t j = 0; j < 50; j++) {
            critical(defuse_bomb);
        }
        uint32_t keyIndex = i % 17;
        char keyChar = key[keyIndex];
        uint32_t keyCharIndex = get_index(alphabet, keyChar);
        uint32_t newCharIndex = (charIndex - keyCharIndex + 35) % 35;
        string[i - start] = alphabet[newCharIndex];
    }
    return string;
}

volatile uint32_t line_assignments[4] = {(uint32_t)-1, (uint32_t)-1, (uint32_t)-1, (uint32_t)-1}; 
char* decrypted_lines[4] = {nullptr, nullptr, nullptr, nullptr};

void get_line() {
    uint32_t line = line_counter;
    if (line >= 100) {
        return;
    }
    line_counter++;
    line_assignments[SMP::me()] = line;
}

void print_line() {
    uint32_t me = SMP::me();
    uint32_t line = line_assignments[me];
    if (line == print_counter) {
        char* decrypted = decrypted_lines[me];
        print_counter++;
        Debug::printf("%s\n", decrypted);
        line_assignments[SMP::me()] = (uint32_t)-1;
    }
}


void work() {
    while (true) {
        uint32_t me = SMP::me();
        if(line_assignments[me] == (uint32_t)-1)
            critical(get_line);
        uint32_t line = line_assignments[me];
        if (line == (uint32_t)-1) {
            return;
        }
        decrypted_lines[me] = decrypt(line * 104, (line + 1) * 104, key);
        while (line_assignments[me] != (uint32_t)-1) {
            critical(print_line);
        }
    }
}


/* Called by all cores */
void kernelMain(void) {
    work();
}
